import React from 'react';
import './Footer.css';

const Footer = () => {
  const currentYear = new Date().getFullYear();

  const quickLinks = [
    { name: 'Home', href: '#home' },
    { name: 'About', href: '#about' },
    { name: 'Skills', href: '#skills' },
    { name: 'Projects', href: '#projects' },
    { name: 'Contact', href: '#contact' }
  ];

  const socialLinks = [
    { name: 'GitHub', icon: '🐙', url: 'https://github.com/yourusername' },
    { name: 'LinkedIn', icon: '💼', url: 'https://linkedin.com/in/yourprofile' },
    { name: 'Twitter', icon: '🐦', url: 'https://twitter.com/yourusername' },
    { name: 'Email', icon: '📧', url: 'mailto:your.email@example.com' }
  ];

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId.replace('#', ''));
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  return (
    <footer className="footer">
      <div className="footer-container">
        <div className="footer-content">
          <div className="footer-section">
            <div className="footer-logo">
              <span className="logo-text">&lt;/&gt; CS Portfolio</span>
            </div>
            <p className="footer-description">
              Computer Science student passionate about creating innovative 
              solutions through code. Always learning, always building.
            </p>
            <div className="footer-social">
              {socialLinks.map((social, index) => (
                <a
                  key={index}
                  href={social.url}
                  className="social-link"
                  target={social.url.startsWith('http') ? '_blank' : '_self'}
                  rel={social.url.startsWith('http') ? 'noopener noreferrer' : ''}
                  title={social.name}
                >
                  <span>{social.icon}</span>
                </a>
              ))}
            </div>
          </div>

          <div className="footer-section">
            <h3 className="footer-title">Quick Links</h3>
            <ul className="footer-links">
              {quickLinks.map((link, index) => (
                <li key={index}>
                  <button
                    className="footer-link"
                    onClick={() => scrollToSection(link.href)}
                  >
                    {link.name}
                  </button>
                </li>
              ))}
            </ul>
          </div>

          <div className="footer-section">
            <h3 className="footer-title">Technologies</h3>
            <div className="tech-stack">
              <span className="tech-item">React</span>
              <span className="tech-item">JavaScript</span>
              <span className="tech-item">Python</span>
              <span className="tech-item">Node.js</span>
              <span className="tech-item">MongoDB</span>
              <span className="tech-item">Git</span>
            </div>
          </div>

          <div className="footer-section">
            <h3 className="footer-title">Get In Touch</h3>
            <div className="contact-info">
              <p>📧 your.email@example.com</p>
              <p>📍 Your City, Country</p>
              <p>💼 Open for opportunities</p>
            </div>
            <button className="back-to-top" onClick={scrollToTop}>
              <span>↑</span>
              Back to Top
            </button>
          </div>
        </div>

        <div className="footer-bottom">
          <div className="footer-divider"></div>
          <div className="footer-bottom-content">
            <p className="copyright">
              © {currentYear} Your Name. All rights reserved.
            </p>
            <p className="made-with">
              Made with <span className="heart">❤️</span> and <span className="code">⚡</span> React
            </p>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
